import { Grid } from "@mui/material";
import LoginPage from "./components/LoginPage/LoginPage";

function App() {
  return (
    <div className="App">
      <Grid container>
        <Grid item sm={2} xs={2}>
          <LoginPage />
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
